import React, {Component} from 'react';
import H1Components from './component'
class App extends Component{
    
    render(){
        var namesArray = ["ivica", "pedza", "vesna", "dekso"]
        const h1Component = function(array) {
           return  array.map((item) => <H1Components key={item} value={item} />);
        } 
        
       
        return (
            <div className="mainDiv container-fluid text-center justify-content-center">
                <div className="row">
                    <div className="col-6">
                        {h1Component(namesArray)}
                    </div> 
                    <div className="col-6">
                    {this.props.value}
                    </div>
                </div>
            </div>
        )
    }
}

export default App;
